import { createSelector } from 'reselect'
import { initialState } from '../reducers/reducers';
// selector
const selectGlobal = (state) => state || initialState;
// reselect function
export const selectTableResults = createSelector(
  selectGlobal ,
  (results => {console.log(results.bbox)})
)
